import {useState, useEffect} from 'react';

export default function Scrollbar(){
  const [height, changeHeight] = useState(0);
  useEffect(() =>{
    var body = document.getElementByTagName('body');
    body.onwheel = e =>{
      console.log(body.style.height);
    }
  });
  return(
    <>
      <div className={'scrollbar'}>
      </div>
    </>
  )
}
